import axios from 'axios';

async function mongodbRetrieve(playerType) {
    const requestObj = {
        'playerType': playerType
    }
    const response = await axios.get('http://localhost:5000/mongodb-players/retrieve', { params: requestObj } );
    return response;
}

export default mongodbRetrieve;
